import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/dashboard/home";
import Login from "./pages/login/login";

function App() {
  return (
    <BrowserRouter>
    <Routes>     
        <Route index element={<Login />} />
        <Route path="home" element={<Home />} />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
